import { useNavigate } from "react-router-dom";
import "./Door1.css";
import Chest from "./Chest";
const Door1 = () => {
  const navigate = useNavigate();

  const handleChest1 = () => {
    navigate("/pirate/stage4/door1/chest1");
  };
  const handleChest2 = () => {
    navigate("/pirate/stage4/door2/chest2");
  };
  const handleChest3 = () => {
    navigate("/pirate/stage4/door3/chest3");
  };

  return (
    <div id="Door1Div">
      <a className="chestlink">
        <Chest data={"/images/gif1.gif"} />
      </a>
      <a className="chestlink" onClick={handleChest2}>
        <Chest />
      </a>
      <a className="chestlink" onClick={handleChest3}>
        <Chest />
      </a>
    </div>
  );
};

export default Door1;
